import React from 'react';

const Car = (props) => {
    const { brandName,price,color,length,image}=props.car
    return (
        <div className="col-lg-3">
            <div>
                <img width="" src={image} alt="" />
            </div>
            <div>
                <p>Name:{ } </p>
                <p>Price: {price}</p>
                <p>Color:{color} </p>
                <p>Length:{length} </p>
                <button>Add To Cart</button>
            </div>
        </div>
    );
};

export default Car;
